import React, { useState } from 'react';
import './signup.css'; // Import the CSS file

function Signup() {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleSignup = () => {
    etch('http://localhost:3000/user/createUser', {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        "Access-Control-Allow-Headers": "Content-Type",
        "Access-Control-Allow-Origin": "*",
        "Access-Control-Allow-Methods": "OPTIONS,POST,GET,PATCH"

      },
      body: JSON.stringify({"email":username, "password":password, "first_name":firstName, }),
    }).then(res=>res.json()).then(json => console.log(json))
      .catch(error => {
        window.alert(error);
        return;
      });
  };

  return (
    <div className="signup-container">
      <div className="signup-form">
        <h1>Create Account</h1>
        <div>
          <input
            type="text"
            placeholder="Email"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
        </div>
        <div className="name-inputs">
            <div>
              <input
                type="text"
                placeholder="First Name"
                value={firstName}
                onChange={(e) => setFirstName(e.target.value)}
              />
            </div>
            <div>
              <input
                type="text"
                placeholder="Last Name"
                value={lastName}
                onChange={(e) => setLastName(e.target.value)}
              />
            </div>
          </div>
        <div>
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </div>
        <button onClick={handleSignup}>CREATE</button>
        <div className="have-account">
                  Already have an account? <a href="#" style={{ textDecoration: 'underline',fontWeight: 'bold' }}>LOGIN</a>
        </div>
      </div>
    </div>
  );
}

export default Signup;
